import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

export default function NearbyFinder() {
  const [query, setQuery] = useState("");
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const navigate = useNavigate();

  // ✅ FIX: filteredResults was missing
  const filteredResults = results;

  const findNearby = async () => {
    if (!query.trim()) return;

    setLoading(true);
    setError("");
    setResults([]);

    try {
      const geocodeRes = await fetch(
        `https://nominatim.openstreetmap.org/search?format=json&q=${query}`
      );
      const geoData = await geocodeRes.json();

      if (!geoData.length) {
        setError("Location not found");
        setLoading(false);
        return;
      }

      const { lat, lon } = geoData[0];

      const overpassQuery = `
        [out:json];
        (
          node["amenity"="hospital"](around:8000,${lat},${lon});
          node["amenity"="clinic"](around:8000,${lat},${lon});
          node["amenity"="pharmacy"](around:8000,${lat},${lon});
        );
        out body;
      `;

      const overpassRes = await fetch(
        "https://overpass-api.de/api/interpreter",
        {
          method: "POST",
          body: overpassQuery,
        }
      );

      const data = await overpassRes.json();

      const formatted = data.elements.map((el) => ({
        name: el.tags?.name || "Unknown",
        address:
          el.tags?.["addr:full"] ||
          el.tags?.["addr:street"] ||
          "Address not available",
        phone: el.tags?.phone || "Phone not available",
        lat: el.lat,
        lon: el.lon,
        type: el.tags?.amenity || "hospital",
      }));

      setResults(formatted);
    } catch (err) {
      setError("Overpass API blocked the request. Please try again later.");
    } finally {
      setLoading(false);
    }
  };

  const openInAppMap = (item) => {
    if (!item.lat || !item.lon) {
      alert("Location not available");
      return;
    }

    navigate("/map", {
      state: {
        hospital: item,
      },
    });
  };

  return (
    <div style={{ padding: "20px" }}>
      <h2>Nearby Doctor / Hospital Finder</h2>

      <input
        type="text"
        placeholder="Enter city / area / pincode"
        value={query}
        onChange={(e) => setQuery(e.target.value)}
        style={{ width: "100%", padding: "10px", marginBottom: "10px" }}
      />

      <button onClick={findNearby} style={{ padding: "8px 14px" }}>
        Find Nearby
      </button>

      <p style={{ fontSize: "12px", marginTop: "8px" }}>
        Location and distance shown are approximate and for educational purposes
        only.
      </p>

      {loading && <p>Loading...</p>}
      {error && <p style={{ color: "red" }}>{error}</p>}

      {!loading && filteredResults.length === 0 && <p>No hospitals found</p>}

      {filteredResults.map((item, index) => (
        <div
          key={index}
          style={{
            border: "1px solid #ddd",
            padding: "12px",
            marginBottom: "12px",
            borderRadius: "8px",
          }}
        >
          <strong>{item.name}</strong>
          <p>{item.address}</p>
          <p>{item.phone}</p>

          {item.lat && item.lon && (
            <>
              <a
                href={`https://www.google.com/maps/dir/?api=1&destination=${item.lat},${item.lon}`}
                target="_blank"
                rel="noreferrer"
                style={{ marginRight: "12px" }}
              >
                Open in Maps
              </a>

              <button
                onClick={() => openInAppMap(item)}
                style={{
                  padding: "6px 10px",
                  borderRadius: "6px",
                  border: "none",
                  background: "#2563eb",
                  color: "#fff",
                  cursor: "pointer",
                }}
              >
                View on App Map
              </button>
            </>
          )}
        </div>
      ))}
    </div>
  );
}
